                  fontSize: 15,
                }}>
                07/02/2020, 05:28
              </Text>
            </View>
          </View>
        </ThirddView>
        <ThirddView>
          <View>
            <ImagesView
              source={image2}
              initHeight="170"
              initWidth="190"
              borderRadius={3}
            />
            <View
              style={{
                backgroundColor: '#0EC776',
                padding: 7,
                borderBottomLeftRadius: 3,
                borderBottomRightRadius: 3,
              }}>
              <Text
                style={{
                  alignSelf: 'center',
                  color: '#ffffff',
                  fontFamily: 'FuturaPt-Medium',

                  fontSize: 15,
                }}>
                {' '}
                07/02/2020, 05:28
              </Text>
            </View>
          </View>
          <View>
            <ImagesView
              source={image2}
              initHeight="170"
              initWidth="190"
              borderRadius={3}
            />
            <View
              style={{
                backgroundColor: '#F25C5D',
                padding: 7,
                borderBottomLeftRadius: 3,
                borderBottomRightRadius: 3,
              }}>
              <Text
                style={{
                  alignSelf: 'center',
                  color: '#ffffff',
                  fontFamily: 'FuturaPt-Medium',

                  fontSize: 15,
                }}>
                07/02/2020, 05:28
              </Text>
            </View>
          </View>
        </ThirddView>
        </ScrollView>
        </View>
       </BackgroundImage>
      </View>
  );
};
const ImagesView = styled(ResponsiveImage)({
  marginTop: heightPercentageToDP(0.5),
});

const ThirddView = styled(View)({
  justifyContent: 'space-evenly',
  flexDirection: 'row',
  marginTop: heightPercentageToDP(0.5),
});

const ThirdView = styled(View)({
  justifyContent: 'space-evenly',
  flexDirection: 'row',
  marginTop: heightPercentageToDP(5),
});
const BackgroundImage = styled(ImageBackground)({
  height:Platform.OS === 'ios' ? '89%' : '100%' ,
  bottom:0,
  marginTop:50,
});
const WelcomeView = styled(View)({
  flexDirection: 'row',
  justifyContent: 'space-between',
  alignItems: 'center',
  marginTop: "-14%",
  marginLeft:12
});
const BackIcon = styled(ResponsiveImage)({
  fontSize: 12,
});
const WelcomeText = styled(Text)({
  fontSize: 24,
  color: '#ffffff',
  fontWeight: '500',
  fontFamily: 'FuturaPT-Medium',
  marginLeft: -widthPercentageToDP(50),
  marginTop: -heightPercentageToDP(0.1),
});
const MenuIcon = styled(ResponsiveImage)({
  alignSelf: 'flex-end',
  marginRight: widthPercentageToDP(4),
});

export default MyPhotos;
